import React from "react";
import './SearchInput.scss';

export const SearchInput = ({setTargetValue}) => {
    return(
        <div className='search-input'>
            <input type="text"

                   placeholder='Search task'
                   onChange={ e => setTargetValue(e.target.value)}/>
        </div>
    )
}
